package net.jeeshop.services.front.appBroker.dao;import java.util.List;import net.jeeshop.core.dao.BaseDao;import net.jeeshop.core.dao.page.PagerModel;import net.jeeshop.services.common.AppBroker;public class AppBrokerDaoImpl implements AppBrokerDao {	private BaseDao dao;	public void setDao(BaseDao dao) {		this.dao = dao;	}	@Override	public PagerModel selectPageList(AppBroker e) {		return dao.selectPageList("front.appBroker.selectPageList",				"front.appBroker.selectPageCount", e);	}	@Override	public List selectList(AppBroker e) {		return dao.selectList("front.appBroker.selectList", e);	}	@Override	public AppBroker selectOne(AppBroker e) {		return (AppBroker) dao.selectOne("front.appBroker.selectOne", e);	}	@Override	public int delete(AppBroker e) {		return dao.delete("front.appBroker.delete", e);	}	@Override	public int update(AppBroker e) {		return dao.update("front.appBroker.update", e);	}		@Override	public int insert(AppBroker e) {		return dao.insert("front.appBroker.insert", e);	}	@Override	public int deleteById(int id) {		return dao.delete("front.appBroker.deleteById", id);	}	@Override	public AppBroker selectById(String id) {		return (AppBroker) dao.selectOne("front.appBroker.selectById", id);	}}